import React,{Component} from "react";

import './stylePessoal.css'

class Pessoal extends Component{

    constructor(props){
        super(props);
        this.state = {
            curso:[
                {fundacao:'Sujeito Programador',curso:'Desenvolvimento mobile e sistema SaaS'},
                {fundacao:'Oracle',curso:'Java Fundations'},                
                {fundacao:'Data Scienceac Ademy',curso:'Big Data Fundamentos 3.0'},                
                {fundacao:'Lupa',curso:' Excel Avançado'},                
                {fundacao:'Data Scienceac Ademy',curso:' Power B.I e Data Science'},                
            ],
            superior:[
                {fundacao:'Unisociesc - Joinville Campus Anista Garibaldi', curso:'Bacharelado em Engenharia da Computação'}
            ],
            hobby:'Recentemente iniciei um novo hobby em pescaria de praia, vejo que é um ótimo esporte para sair da rotina e conhecer coisas novas e diferentes do dia a dia, pratico também hobbies diários que é caminhadas e corrida, planejo incluir em meu hobby diário a academia, podendo equilibrar todos os dias as minhas tarefas com meus hobbys.'
        }
    }

    render(){
        return(
            <div className="containerPessoal">

                <div className="MenuPessoal">
                    <button 
                    className="btnMenu"
                    name="bemVindo"
                    onClick={this.navegar}
                    >
                    Bem-vindo
                    </button>

                    <button 
                    className="btnMenu"
                    name="profissional"
                    onClick={this.navegar}
                    >
                    Trajetória Profissional
                    </button>

                    <button 
                    className="btnMenuAtivo"
                    name="pessoal"
                    onClick={this.navegar}
                    >
                    Trajetória Pessoal
                    </button>
                </div>
                <div className="linhaMenuPessoal"></div>


            </div>
        )
    }
}

export default Pessoal;
